import { getRandomArrayItem } from "./";
import appFinder from "../data/apps/finder";
import appDashboard from "../data/apps/dashboard";
import appAnalytics from "../data/apps/analytics";
import appInbox from "../data/apps/inbox";
import appPrimus from "../data/apps/primus";
import appM24 from "../data/apps/m24";
import appDm from "../data/apps/dm";
var apps = [appFinder, appDashboard, appAnalytics, appInbox, appPrimus, appM24, appDm];
export var getRandomApp = function getRandomApp() {
  return getRandomArrayItem(apps);
};
export var getRandomApps = function getRandomApps(max) {
  if (max === void 0) {
    max = 20;
  }

  var apps = [];

  for (var i = 0; i < max; i++) {
    var app = getRandomApp();
    apps.uniqueid = "app-" + i;
    apps.push(app);
  }

  return apps;
};
